import React from 'react';
import './KursusComponent.css';

const KursusComponent = () => {
  return (
    <div className='wrapper'>
      <div className='gambar'></div>
      <p>Gambbar</p>
      <p>Harga Paket</p>
      <p>Desc Paket</p>
    </div>
  );
};

export default KursusComponent;
